import { useEffect, useState } from 'react';
import './App.css';

function App() {
  // definizioni degli stati
  const [commessa, setCommessa] = useState([])

  useEffect(() => {
    fetch("http://localhost:8080/commessa").then(r => r.json()).then(body => {
      setCommessa(body)
    })
  },[])

  const commessaJSX = commessa.map(commessa => (<li key={commessa.id}>{commessa.titolo}"\n"{commessa.descrizione}</li>))
  return (
    <div className="App">
      <header className="App-header">
        commessa
        {commessaJSX}
      </header>
    </div>
  );
}

export default App;
